import React, {Component} from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import UndoIcon from '@material-ui/icons/Undo';
import UndoIconVoid from '@material-ui/icons/Undo';
import RedoIcon from '@material-ui/icons/Redo';
import RedoIconVoid from '@material-ui/icons/Redo';


const styles = theme => ({
    history: {
        marginLeft: 'auto',
    },
});
function MakeUndoIcon(props) {
    const {state}=props;
    if (state.Navigate.canUndo(state)) {
	return <UndoIcon/>
    } else {
	return <UndoIconVoid/>
    }
}
function MakeRedoIcon(props) {
    const {state}=props;
    if (state.Navigate.canRedo(state)) {
	return <RedoIcon/>
    } else {
	return <RedoIconVoid/>
    }
}
class History extends Component {
    state = {anchorEl: null,};
    render() {
        const { classes, state } = this.props;
	this.undoClick = event => {state.Path.undo(state)};
	this.redoClick = event => {state.Path.redo(state)};
	this.onClose = () => {this.setState();};
	return (
		<div className={classes.history}>
		 <Button
                    onClick={this.undoClick}
		   >
		   {<MakeUndoIcon state={state} />}
                 </Button>
		 <Button
                    onClick={this.redoClick}
		   >
		   {<MakeRedoIcon state={state}/>}
                 </Button>
		</div>
	);
    }
}

History.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(History);
